    true,nt"url": null,nt"notes": "Welcome to the second issue of NITRD Leads
    IT, a quarterly newsletter of the Networking and Information Technology Research
    and Development (NITRD) Program. I believe that NITRD helps make &#34;awesome&#34;
    happen because of the intelligence, creativity, and dedication of people, when thoughtfully
    applied to important challenges. This newsletter highlights examples of the giant
    leaps that NITRD helps enable. They started as big ideas by someone who was inspired
    to do more for their agency and our nation. If you have a bold idea about how NITRD
    can help advance agency missions and National priorities, weu2019d like to hear
    from you. We want to make amazing things happen! - Dr. Bryan Biegel (Director of
    the National Coordination Office for Networking and Information)",nt"license_title":
